import React from 'react';
import { Link } from 'react-router-dom'

const Navbar = () => {
    return(
        <nav className="nav-wrapper">
            <div className="container">
                <Link to="/" >HAUD</Link>
                <NavLink to="/" >HAUD</NavLink>
                <NavLink to="/" >HAUD</NavLink>
                <NavLink to="/" >HAUD</NavLink>
            </div>
        </nav>
    )
}

export default Navbar
